const fz = require('zigbee-herdsman-converters/converters/fromZigbee');
const tz = require('zigbee-herdsman-converters/converters/toZigbee');
const exposes = require('zigbee-herdsman-converters/lib/exposes');
const reporting = require('zigbee-herdsman-converters/lib/reporting');
const constants = require('zigbee-herdsman-converters/lib/constants');
const e = exposes.presets;
const ea = exposes.access;

const tzLocal = {
    node_config: {
        key: ['reading_interval', 'config_report_enable', 'comparison_previous_data', 'pool_rate_on', 'tx_radio_power'],
        convertSet: async (entity, key, rawValue, meta) => {
			const endpoint = meta.device.getEndpoint(1);
            const lookup = {'OFF': 0x00, 'ON': 0x01};
            const value = lookup.hasOwnProperty(rawValue) ? lookup[rawValue] : parseInt(rawValue, 10);
            const payloads = {
                reading_interval: ['genPowerCfg', {0x0201: {value, type: 0x21}}],
				config_report_enable: ['genPowerCfg', {0x0275: {value, type: 0x10}}],
				comparison_previous_data: ['genPowerCfg', {0x0205: {value, type: 0x10}}],
				pool_rate_on: ['genPowerCfg', {0x0216: {value, type: 0x10}}],
				tx_radio_power: ['genPowerCfg', {0x0236: {value, type: 0x28}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	node_config2: {
         key: ['raw_temperature', 'raw_temperature_cal', 'raw_temperature_recal'],
		 convertSet: async (entity, key, rawValue, meta) => {
			const endpoint = meta.device.getEndpoint(2);
            const value = parseInt(rawValue);
            const payloads = {
                raw_temperature_cal: ['msTemperatureMeasurement', {0x0008: {value, type: 0x29}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	node_config3: {
        key: ['sensor_identifier'],
        convertGet: async (entity, key, meta) => {
			const endpoint = meta.device.getEndpoint(1);
            const payloads = {
                sensor_identifier: ['genBasic', 0xA19B],
            };
            await endpoint.read(payloads[key][0], [payloads[key][1]]);
        },
    },
	node_config4: {
         key: ['pressure_offset'],
		 convertSet: async (entity, key, rawValue, meta) => {
			const endpoint = meta.device.getEndpoint(1);
            const value = parseInt(rawValue);
            const payloads = {
                pressure_offset: ['msPressureMeasurement', {0x0210: {value, type: 0x29}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
};

const fzLocal = {
    node_config: {
        cluster: 'genPowerCfg',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0201)) {
                result.reading_interval = msg.data[0x0201];
            }
			if (msg.data.hasOwnProperty(0x0275)) {
				result.config_report_enable = ['OFF', 'ON'][msg.data[0x0275]];
            }
			if (msg.data.hasOwnProperty(0x0205)) {
				result.comparison_previous_data = ['OFF', 'ON'][msg.data[0x0205]];
            }
			if (msg.data.hasOwnProperty(0x0216)) {
                result.pool_rate_on = ['OFF', 'ON'][msg.data[0x0216]];
            }
			if (msg.data.hasOwnProperty(0x0236)) {
                result.tx_radio_power = msg.data[0x0236];
            }
            return result;
        },
    },
	node_config2: {
        cluster: 'msTemperatureMeasurement',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0007)) {
                result.raw_temperature = msg.data[0x0007];
            }
            if (msg.data.hasOwnProperty(0x0009)) {
                result.raw_temperature_recal = msg.data[0x0009];
            }
            if (msg.data.hasOwnProperty(0x0008)) {
                result.raw_temperature_cal = msg.data[0x0008];
            }
            return result;
        },
    },
	node_config3: {
        cluster: 'msPressureMeasurement',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
			bar = parseFloat(msg.data['measuredValue']) / 1000.0;
			return {bar : bar};
        },
    },
	node_config4: {
        cluster: 'msPressureMeasurement',
        type: ['attributeReport', 'readResponse'],
		convert: (model, msg, publish, options, meta) => {
			psi = parseFloat(msg.data['measuredValue']) / 68.94757;
			return {psi : psi};
        },
    },
	node_config7: {
        cluster: 'msPressureMeasurement',
        type: ['attributeReport', 'readResponse'],
		convert: (model, msg, publish, options, meta) => {
			pressure = parseFloat(msg.data['measuredValue']) / 10.0;
			return {pressure : pressure};
        },
    },
	node_config5: {
        cluster: 'msPressureMeasurement',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
			if (msg.data.hasOwnProperty(0x0210)) {
                result.pressure_offset = msg.data[0x0210];
            }
            return result;
        },
    },
	node_config6: {
        cluster: 'genBasic',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
			if (msg.data.hasOwnProperty(0xA19B)) {
                result.sensor_identifier = msg.data[0xA19B];
            }
            return result;
        },
    },
	uptime: {
        cluster: 'genTime',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
			if (msg.data.hasOwnProperty('localTime')) {
				return {uptime: Math.round(msg.data.localTime/60/60)};
			}
        },
    },
};



const definition = {
        zigbeeModel: ['EFEKTA_PST_V1'],
        model: 'EFEKTA_PST_V1',
        vendor: 'EfektaLab',
        description: 'EFEKTA PST v1 - Water/gas pressure smart sensor.',
        fromZigbee: [fz.pressure, fz.battery, fzLocal.node_config, fzLocal.node_config2, fzLocal.node_config3, fzLocal.node_config4, fzLocal.node_config5, fzLocal.node_config6, fzLocal.node_config7, fz.temperature, fzLocal.uptime],
        toZigbee: [tz.factory_reset, tzLocal.node_config, tzLocal.node_config2, tzLocal.node_config3, tzLocal.node_config4],
        configure: async (device, coordinatorEndpoint, logger) => {
            const endpointOne = device.getEndpoint(1);
			const endpointTwo = device.getEndpoint(2);
            await reporting.bind(endpointOne, coordinatorEndpoint, ['genPowerCfg', 'msPressureMeasurement']);
			await reporting.bind(endpointTwo, coordinatorEndpoint, ['msTemperatureMeasurement']);
			const overrides1 = {min: 0, max: 21600, change: 1};
			const overrides2 = {min: 30, max: 1800, change: 10};
			const overrides3 = {min: 30, max: 1800, change: 25};
            await reporting.batteryVoltage(endpointOne, overrides1);
            await reporting.batteryPercentageRemaining(endpointOne, overrides1);
			await reporting.batteryAlarmState(endpointOne, overrides1);
            await reporting.pressure(endpointOne, overrides2);
			await reporting.temperature(endpointTwo, overrides3);
        },
        icon: 'data:image/png;base64,',
		exposes: [exposes.numeric('pressure', ea.STATE).withUnit('kPa').withDescription('pressure in kPa'),
		    exposes.numeric('bar', ea.STATE).withUnit('bar').withDescription('pressure in bar'),
			exposes.numeric('psi', ea.STATE).withUnit('psi').withDescription('pressure in psi'),
			e.temperature(),
			e.battery_low(),
			e.battery(),
			e.battery_voltage(),
		    exposes.numeric('reading_interval', ea.STATE_SET).withUnit('Seconds').withDescription('Setting the sensor reading interval. Setting the time in seconds, by default 15 seconds')
                .withValueMin(5).withValueMax(360),
			exposes.enum('tx_radio_power', ea.STATE_SET, [0, 4]).withDescription('Set TX Radio Power, dbm)'),
			exposes.binary('pool_rate_on', ea.STATE_SET, 'ON', 'OFF').withDescription('Pool rate on off'),
			exposes.binary('config_report_enable', ea.STATE_SET, 'ON', 'OFF').withDescription('Enable reporting based on reporting configuration'),
		    exposes.binary('comparison_previous_data', ea.STATE_SET, 'ON', 'OFF').withDescription('Enable сontrol of comparison with previous data'),
			exposes.numeric('pressure_offset', ea.STATE_SET).withUnit('kPa').withDescription('Adjust pressure')
                .withValueMin(-100.0).withValueMax(100.0),
			exposes.numeric('raw_temperature_cal', ea.STATE_SET).withValueStep(1).withDescription('Adjust raw temperature').withValueMin(-8192).withValueMax(8192),
			exposes.numeric('raw_temperature', ea.STATE).withDescription('Sensor raw temperature'),
			exposes.numeric('raw_temperature_recal', ea.STATE).withDescription('Кecalibrated sensor raw temperature'),
			exposes.numeric('uptime', ea.STATE).withUnit('Hours').withDescription('Uptime'),
			exposes.numeric('sensor_identifier', ea.STATE).withDescription('Sensor type, identifier')],
};

module.exports = definition;